  `vacancy_key_skills` varchar(145) COLLATE utf8mb4_unicode_ci NOT NULL,
  `vacancy_schedule` enum('Полный день','Сменный график','Гибкий график','Удаленная работа','Вахтовый метод') COLLATE utf8mb4_unicode_ci NOT NULL,
  `vacancy_experience` enum('Нет опыта','От 1 года до 3 лет','От 3 до 6 лет','Более 6 лет') COLLATE utf8mb4_unicode_ci NOT NULL,
  `vacancy_address` varchar(145) COLLATE utf8mb4_unicode_ci NOT NULL,
