  `vacancy_salary` bigint(20) DEFAULT NULL,
  `vacancy_name` varchar(45) COLLATE utf8mb4_unicode_ci NOT NULL,
  `vacancy_area` varchar(145) COLLATE utf8mb4_unicode_ci NOT NULL,
  `vacancy_created_at` datetime NOT NULL DEFAULT current_timestamp(),
  `vacancy_published_at` datetime NOT NULL DEFAULT current_timestamp(),
